import { Link } from 'react-router-dom';
import styled from 'styled-components'

const Ul = styled.ul`
    #li{
        margin-left: 40px;
        text-decoration: none;
        padding: 10px;
        color: white;
    }
    #li:hover {
        color: #f1356d;
    }
`;

const RightNav = () => {
    return ( 
        <Ul>
            <div className = "links">
                <Link to = "/" id = "li">Home</Link>
                <Link to = "/AboutUs" id = "li">About Us</Link>
            </div>
        </Ul>
    );
}
 
export default RightNav;
